script: |
  super -f text -I q9610.spq | sort > q9610.out

inputs:
  - name: q9610.spq
    data: |
      SELECT DISTINCT col1 * + col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 + + col1 NOT BETWEEN col0 * col2 * + col1 * - 61 AND NULL;
  - name: tab2

outputs:
  - name: q9610.out
    data: |
